import axios from 'axios';

const STOCK_API_BASE_URL = "http://localhost:9090/api/v1/stocks";

class StockService {

    getEmployees(){
        return axios.get(STOCK_API_BASE_URL);
    }

    createEmployee(employee){
        return axios.post(STOCK_API_BASE_URL, employee);
    }

    getEmployeeById(employeeId){
        return axios.get(STOCK_API_BASE_URL + '/' + employeeId);
    }

    updateEmployee(employee, employeeId){
        return axios.put(STOCK_API_BASE_URL + '/' + employeeId, employee);
    }

    deleteEmployee(employeeId){
        return axios.delete(STOCK_API_BASE_URL + '/' + employeeId);
    }
}

export default new EmployeeService()
